import React from 'react'

export const PayerCard = ({ payer }) => {
  return (
    <>
      <h2>Платник</h2>

      <p>Код платника: <a href={payer.payerCode} target="_blank" rel="noopener noreferrer">{payer.payerCode}</a></p>
      /* <p>Откуда: <a href={link.from} target="_blank" rel="noopener noreferrer">{link.from}</a></p>
      <p>Количество кликов по ссылке: <strong>{link.clicks}</strong></p> */
      <p>Дата создания: <strong>{new Date(payer.date).toLocaleDateString()}</strong></p>
    </>
  )
}
